import './App.css';
import React, { useState, useEffect } from "react";
import axios from "axios";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/ratings" component={Ratings} />
        <Route path="/createuser" component={CreateUser} />
        <Route path="/loginuser" component={LoginUser} />
        <Route path="/viewrating" component={ViewRating} />
        <Route path="/deleterating" component={DeleteRating} />
        <Route path="/addnewrating" component={AddNewRating} />
        <Route path="/updaterating" component={UpdateRating} />
      </Switch>
    </Router>
  );
}

function Pages() {
  return (
    <div>
      <Link to="/ratings">Ratings</Link>
      <Link to="/createuser">Create User</Link>
      <Link to="/loginuser">Login User</Link>
      {/* Add links for other routes */}
    </div>
  );
}

export default App;
